import React, { Component } from "react";
import { connect } from "react-redux";
import { Link } from 'react-router-dom'
class Login extends Component {
  render() {
    return (
        <div className="container">
                <div className="cart">
                    <h5>Please Log In:</h5>
                    
                                
                                    <div className="item-desc">
                                        
                                       
                                        <p><label htmlFor="exampleInputEmail1">Email address</label>
                <input type="email" 
                       className="form-control" 
                       id="email" 
                       aria-describedby="emailHelp" 
                       placeholder="Enter email" 
                     
                />
                <small id="emailHelp" className="form-text text-muted">We'll never share your email with anyone else.</small></p> 
                
                                        <p><label htmlFor="exampleInputPassword1">Password</label>
                <input type="password" 
                       className="form-control" 
                       id="password" 
                       placeholder="Password"
                     
                />
                <small id="emailHelp" className="form-text text-muted">We'll never share your email with anyone else.</small></p> 
                                        <p>
                                            <b>Quantity: {this.props.selectedItem.quantity}</b> 
                                        </p>
                                        <p>
                                            <b>Item ID: {this.props.selectedItem.id}, ISBN: {this.props.selectedItem.isbn}</b> 
                                        </p>
                                        <p>
                                            <b>Dimensions: {this.props.selectedItem.width}x{this.props.selectedItem.height}</b> 
                                        </p>
                                        <p>
                                            <b>Synopsis: {this.props.selectedItem.info}</b> 
                                        </p>
                                        <div className="add-remove">
                                            <Link to="/"><a className="waves-effect waves-light btn">Back to Books</a></Link>
                                        </div>
                                    </div>
                                    
                               
                </div> 
                      
            </div>
    );
  }
}
const mapStateToProps = (state) => {
  return {
    items: state.items,
    selectedItem: state.selectedItem,
  };
};
export default connect(mapStateToProps)(Login);
